(54242, 24384, 0, 1, 'Black 1''30秒版本', '', '2012-10-27 00:00:00', 2012, 0, 2, 7, '黑暗   讓我墜入深淵    \r\n魁儡   掙脫不安躁動 \r\n幻境   觸手可及      \r\n野火   四周頻頻呼喚 \r\n焦躁   不安情緒失控    \r\n炙熱   瞬間燃燒一切 \r\n等待   宿命支配    \r\n臨界點尋找誰的身影   \r\n \r\n我們的世界在這瞬間已經崩潰 \r\n再多的安慰現在顯得太過無謂\r\n \r\n美好畫面停格瞬間    原來步伐已經走偏 \r\n距離慢慢越拉越遠    背影逐漸消失不見\r\n \r\n混亂的氛圍  讓人選擇沉默一切\r\n混亂的空間  讓人無法藏匿一切\r\n', '', 91, '', 'Yuyu Hsu', 'Yuyu Hsu', '', '映象唱片', '', 0, 0, 1, '2012-09-24 09:30:58', '2014-02-03 14:23:48', '2014-02-03 14:23:48'),
(54243, 24384, 0, 2, 'Gray', '', '2012-10-27 00:00:00', 2000, 20, 0, 7, '冰冷的空氣 讓人無法呼吸  \r\n離去的背影 畫面卻如此清晰  \r\n轉身的瞬間 背景已碎成片片  \r\n\r\n終於了解 煙霧中的完美 \r\n想要放縱 卻又無從解脫 \r\n一圈一圈 緊緊纏繞的羈絆 \r\n懊悔 最後只剩下我\r\n\r\n能不能放開手 給些 給些自由  \r\n能不能閉上眼 給些 給些空間 \r\n複雜的情緒 拉扯糾結 \r\n不知不覺 盡頭就在眼前\r\n\r\n我不能改變什麼 我不能改變什麼 我在你心裡什麼都沒有\r\n', '', 210, '', 'Yuyu Hsu', 'Yuyu Hsu', '普魯士藍 陳信華', '映象唱片', '', 0, 0, 1, '2012-09-24 09:32:48', '2014-02-03 14:23:44', '2014-02-03 14:23:44'),
(54244, 24384, 0, 3, 'Blue 1''30秒', '', '2012-10-27 00:00:00', 2012, 0, 2, 7, '耳機裡流洩出的哀傷旋律\r\n仔細聆聽歌詞的涵義\r\n突然有種悲傷情緒蔓延 \r\n無法抑止\r\n\r\n如果有天能夠再次的遇見    \r\n是否還能擁有相同的世界\r\n逝去的光陰不斷提醒著我    \r\n一去不復返\r\n\r\n如果時間能夠回到那一瞬間\r\n流下的眼淚是否能夠就此停止\r\n負面的情緒是否\r\n也可以漸漸平息  \r\n無盡的漂泊何時才能停留\r\n綿延的思念加速了哀愁\r\n聲聲的呼喚此刻     \r\n你是否聽見  \r\n你是否能聽得見\r\n\r\n一瞬間已經注定無法相遇\r\n心中的遺憾不停擴大蔓延\r\n你總是告訴我要學習勇敢學習獨立\r\n但這次回頭你已經不在身邊\r\n我試著忍住悲傷試著選擇遺忘\r\n往事每一幕都在腦海中不停迴盪\r\n再多的安慰也無法改變結局\r\n最後只能在回憶裡尋找你\r\n', '', 91, '', 'Yuyu Hsu', 'Yuyu Hsu', '', '映象唱片', '', 0, 0, 1, '2012-09-24 09:33:28', '2014-02-03 14:23:41', '2014-02-03 14:23:41'),
