(54295, 91245, 0, 1, '一百天', '', '2012-09-24 00:00:00', 2012, 0, 2, 7, '一百天\r\n\r\n牆上還貼著舊照片  到現在還很懷念\r\n但是  你已經不在身邊\r\n\r\n手上還握著舊項鍊   我們都好久不見\r\n是否  你也想再見一面\r\n\r\n回憶告別那天  重傷害你說得很淺\r\n怕多傷彼此一點\r\n\r\n我們都曾以為  愛情就是一切\r\n要時時相見  刻刻掛念\r\n讓相處漸漸索然無味\r\n當愛情  只剩人在身邊\r\n心模糊了焦點  人漸行漸遠\r\n\r\n乾燥的咖啡渣還有一絲餘味\r\n熱開水是否能喚回\r\n不論再回沖幾遍  逝去的愛不再濃烈\r\n如水的滋味  像這一百天', '', 225, '', '陳含章', '蘇育霆', '蘇育霆', '', '', 0, 1, 0, '2012-09-24 21:08:01', '2015-03-12 13:55:56', '0000-00-00 00:00:00'),
(54296, 116418, 5098, 1, '【面具傳說】詞:水漾貝啦 曲:朱康', '一樣是奏鳴曲方式的寫詞，不同的方式會激盪出不同的火花呀\r\n\r\n一首如果我有空，一定會想幫他做一個主題式的短篇小說的歌曲，\r\n這首歌讓我很有感覺，詞的意境，曲的旋律，歌手的詮釋太動人，\r\n我很喜歡的歌…但是我畫那個面具畫的很腦殘呀', '2012-09-24 00:00:00', 2012, 0, 1, 7, '＜面具傳說＞\r\n詞:水漾貝啦2012年1月8日\r\n曲:朱康2012年1月26日\r\n\r\n風 輕吹 輕吹 吹拂盛開般花朵少女的臉龐\r\n羞澀中 帶著一抹 淺淺的虹 \r\n如夢 似幻 繽紛 炫爛…恬美迷人\r\n\r\n火 灼烈 灼烈 肆無忌憚 狂放跳躍撒野  帶著惡魔的詛咒\r\n那戴在臉上永遠摘不去的是 少年無法擺脫的愁 \r\n\r\n ~相遇~\r\n寂寞的夜裏 幻化七彩瑰麗煙火  只為圖得她愉悅笑容\r\n凜冽寒冬裡 幻化身旁溫暖爐火 只為圖得她芳心垂留\r\n( 一直一直到永久) \r\n\r\n--\r\n\r\n少女戀上的是少年還是火 少年忘記了身上的魔咒\r\n只為圖得她愉悅笑容  一直一直到永久\r\n\r\n少女戀上的是少年還是火  少年忘記了身上的魔咒\r\n只為圖得她芳心垂留  一直到永久\r\n\r\n～間奏～\r\n\r\n火 灼烈 灼烈  肆無忌憚 \r\n狂放跳躍撒野  帶著惡魔的詛咒\r\n化身成火卻永遠摘不去 是少年無法擺脫的愁\r\n\r\n（相遇）\r\n寂寞的夜裏 幻化七彩瑰麗煙火\r\n只為圖得她愉悅笑容\r\n凜冽寒冬裡 幻化溫暖爐火\r\n只為圖得她芳心垂留\r\n\r\n少女戀上的是少年還是火\r\n少年忘記了身上的魔咒\r\n只為圖得她愉悅笑容\r\n一直一直到永久\r\n面具傳說－水漾貝啦 -2\r\n	\r\n火 灼烈 灼烈 肆無忌憚\r\n狂放跳躍撒野\r\n帶著惡魔的詛咒\r\n化身成火卻永遠摘不去 是少年無法擺脫的愁\r\n\r\n\r\n寂寞夜裏 幻化七彩煙火　\r\n只為圖得　她的笑容　\r\n凜冽寒冬　溫暖爐火\r\n只為圖得　芳心垂留\r\n\r\n誰的詛咒 誰的寂寞  誰的溫柔 誰的殘容\r\n脫不下的 面具傳說  沒有承諾 怎麼不朽\r\n\r\n～小尾奏～\r\n\r\n少女戀上的是少年還是火 少年忘記了身上的魔咒\r\n蒼白面具底下 吻烙下了殘容  一直到永久\r\n\r\n(合音)\r\n少女戀上的是少年還是火 少年忘記了身上的魔咒\r\n蒼白面具底下 吻烙下了殘容  一直到永久\r\n', '', 327, '', '朱康', '水漾貝啦', '', '', '', 0, 1, 0, '2012-09-24 21:47:59', '2015-03-12 13:55:56', '0000-00-00 00:00:00'),
