(54298, 128361, 5099, 2, '微醺的午後', '', '2012-09-25 00:00:00', 2000, 20, 0, 5, '一二三四還有五六七八 \r\n有幾隻羊 \r\n我的呼吸輕輕的在大樹下 \r\n今天的陽光剛剛好沒有囂張的胡鬧 \r\n風也剛剛好帶點甜甜的味道 \r\n就這麼剛好我也有一點無聊 \r\n快逗我笑\r\n躺下吧 在溫柔草地上 \r\n數著花 數著蝴蝶靠近哪一朵花 \r\n拿著鉛筆在天空上畫畫 \r\n隨便畫 反正還有白雲當橡皮擦 \r\n身邊有人開始彈吉他 \r\n還有我最愛的陽光 \r\n在這微醺的午後 我都醉了\r\n就這樣吧陪我一起玩耍 \r\n啦啦啦啦 \r\n我的世界一天一天變大 \r\n我的眼睛裡看到的天馬行空的什麼 \r\n耳朵裡聽見的是你淡淡的歌聲 \r\n嘴巴裡唱的是我愛的那首歌 \r\n所以一起', '', 279, '', '', '', '', '', '', 1, 1, 0, '2012-09-24 22:35:01', '2015-03-12 13:55:56', '0000-00-00 00:00:00'),
(54299, 128361, 5099, 3, '離開你的森林', '', '2012-09-25 00:00:00', 2000, 20, 0, 5, '看著你的小眼睛 好像看著我自己\r\n走進你的小森林 身邊都是做夢的精靈\r\n也許我應該回去 不該呆在這禁忌園地\r\n但我開始沒聲音 然後就突然變成你\r\n變成你的小眼睛 變成看著我自己\r\n我們交換了身體 怎麼回事我竟然很高興\r\n拋開了所有壓力 走過新的小旅行\r\n我在這邊好心情\r\n但 我怎麼能\r\n拋開所有的一切 從此消失不見\r\n你在哪裡\r\n快點回來找我讓我變回我自己\r\nOh 新的生活 這樣就夠 我有我的世界\r\n所以我已經離開你的森林\r\n也有了勇氣\r\n我常常在羨慕嫉妒別人擁有的 總是懷疑自己是不是被遺忘了\r\n我怎麼不能 為什麼不能 好多好多願望掛在許願樹上了\r\n但當願望一一成真了 回頭看看自己早已不像我自己\r\n怎麼能忘記 怎麼能放棄 怎麼能夠忘掉丟掉甩掉我自己\r\n在轉角我又看到你', '', 308, '', '', '', '', '', '', 1, 1, 0, '2012-09-24 22:39:29', '2015-03-12 13:55:56', '0000-00-00 00:00:00'),
(54300, 128361, 5099, 4, '星星', '', '2012-09-25 00:00:00', 2000, 20, 0, 5, '落下的種子會長成怎樣的花\r\n花開了以後會結成怎樣的果\r\n我們都是一顆種子 一種未知 一種未知\r\n好不容易看見天空看見星星\r\n卻看見了無邊無盡遙遠距離\r\n找不到我要的光芒 沒了方向 沒了方向\r\n這樣就可以\r\n那樣也可以\r\n為什麼長大就忘了\r\n忘記了自己的選擇\r\n等一等再等一等\r\n星星出現又不見\r\n才發現原來只是雲朵在飄著', '', 325, '', '', '', '', '', '', 1, 1, 0, '2012-09-24 22:44:29', '2015-03-12 13:55:56', '0000-00-00 00:00:00'),
(54301, 128361, 5099, 5, '透明雨衣(demo)', '', '2012-09-25 00:00:00', 2000, 20, 0, 5, '我躲在透明的雨衣裡面\r\n隔著雨天偷看這個世界\r\n不想面對 泡過水的布鞋\r\n只好又回到自己的房間\r\n我躲在透明的雨衣裡面\r\n戴著耳機逃避雨聲的戲謔\r\n不想看見 卻還是看得見\r\n手心的是水還是我的眼淚\r\n嘩啦啦啦 嘩啦啦啦\r\n我躲在透明的雨衣裡面\r\n用望遠鏡看對面的街\r\n找尋一隻 躲在屋簷的貓\r\n猜想她的靈魂跟我一樣\r\n我躲在透明的雨衣裡面\r\n畫了一顆太陽在胸口前面\r\n張開雙手 假裝我還有你\r\n假裝我身上沒有這件雨衣\r\n嘩啦啦啦 嘩啦啦啦\r\n嘩啦啦啦 嘩啦啦啦\r\n也許這是多雨的季節\r\n也多出了自溺的時間\r\n那一隻貓走出屋簷 發現了我\r\n輕輕走過我的窗沿\r\n然後停在我家的門前\r\n脫下唯一的防備\r\n穿上剛被陽光曬乾的布鞋', '', 266, '', '', '', '', '', '', 1, 1, 0, '2012-09-24 22:49:04', '2015-03-12 13:55:57', '0000-00-00 00:00:00'),
(54302, 128361, 5099, 6, 'bonus track', '', '2012-09-25 00:00:00', 2000, 20, 0, 5, '一二三四還有五六七八 \r\n有幾隻羊 \r\n我的呼吸輕輕的在大樹下 \r\n今天的陽光剛剛好沒有囂張的胡鬧 \r\n風也剛剛好帶點甜甜的味道 \r\n就這麼剛好我也有一點無聊 \r\n快逗我笑\r\n躺下吧 在溫柔草地上 \r\n數著花 數著蝴蝶靠近哪一朵花 \r\n拿著鉛筆在天空上畫畫 \r\n隨便畫 反正還有白雲當橡皮擦 \r\n身邊有人開始彈吉他 \r\n還有我最愛的陽光 \r\n在這微醺的午後 我都醉了\r\n就這樣吧陪我一起玩耍 \r\n啦啦啦啦 \r\n我的世界一天一天變大 \r\n我的眼睛裡看到的天馬行空的什麼 \r\n耳朵裡聽見的是你淡淡的歌聲 \r\n嘴巴裡唱的是我愛的那首歌 \r\n所以一起', '', 265, '', '', '', '', '', '', 1, 1, 0, '2012-09-24 22:53:03', '2015-03-12 13:55:57', '0000-00-00 00:00:00'),
